// DropDown.stories.js

import React from 'react';
import { storiesOf } from '@storybook/react';
import DropDown from './DropDown';

storiesOf('DropDown', module)
  .add('내 노래', () => (
    <DropDown
      type="내 노래"
      options={['이름순', '최근저장순', '오래된순']}
      onChange={(option) => console.log(option)}
    />
  ))
  .add('내 이웃', () => (
    <DropDown
      type="내 이웃"
      options={['이름순', '랭킹순']}
      onChange={(option) => console.log(option)}
    />
  ))
  .add('학습기록', () => (
    <DropDown
      type="학습기록"
      options={['성적순', '최신순', '오래된순']}
      onChange={(option) => console.log(option)}
    />
  ))
  .add('내 게시글', () => (
    <DropDown
      type="내 게시글"
      options={['최근순', '오래된순']}
      onChange={(option) => console.log(option)}
    />
  ));
